export default function AdminDashboard({ orders }) {
  return (
    <div className="bg-white p-6 rounded-xl shadow border fade-in">
      <h2 className="text-xl font-bold mb-4">Admin Orders Dashboard</h2>

      {orders.length === 0 ? (
        <p className="text-gray-400">No orders yet</p>
      ) : (
        <table className="w-full text-sm">
          <thead>
            <tr className="border-b">
              <th className="text-left p-2">Item</th>
              <th>Qty</th>
              <th>Total</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {orders.map(o => (
              <tr key={o.id} className="border-b">
                <td className="p-2">{o.item}</td>
                <td className="text-center">{o.qty}</td>
                <td className="text-center">â‚¹{o.total}</td>
                <td className="text-green-600 text-center">CREATED</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
